import React from "react";

function ProductsList(props) {
  return (
    <>
      {props.map((props) => (
        <li key={props.id}>
          <b>{props.title}</b>
        </li>
      ))}
    </>
  );
}

function App() {
  const products = [
    { id: 0, title: "Bread", price: 19.99 },
    { id: 1, title: "Milk", price: 29.99 },
    { id: 2, title: "Cheese", price: 35.99 },
    { id: 3, title: "Water", price: 15.99 },
  ];
  return <div>{ProductsList(products)}</div>;
}

export default App;
